import React from 'react'
import { useAuth0 } from '@auth0/auth0-react'

const AuthWrapper = ({children}) => {
  const {isLoading,error} = useAuth0()

  if(isLoading){
    return <Wrapper>
      <h1>Loading</h1>
    </Wrapper>
  }

  if(error){
    return <Wrapper>
      <h4>{error.message}</h4>
    </Wrapper>
  }

  return (
    <>
    {children}
    </>
  )
}

export default AuthWrapper
